import '../App.css'
import { HomeNavBar } from '../Layouts/HomeNavBar';
import { MainHome } from '../Layouts/MainHome';
import MenuDesplegable from '../Layouts/MenuDesplegable';
import WindowModal from '../Layouts/WindowModal';

export function Home() {
    return ( 
        <div>
            <div className='home_header'>
                <div><HomeNavBar/></div>
                <div><MenuDesplegable/></div>
            </div>
            {/* <div className='home_main'>
                <div><MainHome/></div>
            </div> */}
            <WindowModal/>
        </div>
    );
}
